                          "text": "<p style=\"text-align: justify;\"><span style=\"color: #000000;font-size: 7pt;font-family: 微软雅黑;\">本基金通过指数化投资，争取在扣除各项费用之前获得与标的指数相似的总回报，紧密跟踪标的指数，追求跟踪偏离度及跟踪误差的最小化。在正常市场情况下，本基金力争使日均偏离度的绝对值不超过</span><span style=\"color: #000000;font-size: 7pt;font-family: 微软雅黑;\">0.35%</span><span style=\"color: #000000;font-size: 7pt;font-family: 微软雅黑;\">，年跟踪误差不超过</span><span style=\"color: #000000;font-size: 7pt;font-family: 微软雅黑;\">4%</span><span style=\"color: #000000;font-size: 7pt;font-family: 微软雅黑;\">。</span></p>",
