                          "text": "<p style=\"text-align: center;\"><span style=\"color: #FFFFFF;font-size: 7pt;font-family: 微软雅黑;font-weight: bold;\">投资</span><span style=\"color: #FFFFFF;font-size: 7pt;font-family: 微软雅黑;font-weight: bold;\">范围</span></p>",
