              "content": "<p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: Calibri;font-weight: bold;\">超额显著：</span><span style=\"font-size: 12pt;font-family: Calibri;\">成立以来每个自然年度正收益</span><span style=\"font-size: 12pt;font-family: Calibri;font-weight: bold;\">，</span><span style=\"font-size: 12pt;font-family: Calibri;\">各年度收益均超业绩比较基准，其中</span><span style=\"font-size: 12pt;font-family: Calibri;\">2024</span><span style=\"font-size: 12pt;font-family: Calibri;\">年以来收益</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">4.54%</span><span style=\"font-size: 12pt;font-family: Calibri;\">，超额收益达</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">4.34%</span></p><p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: 微软雅黑;font-weight: bold;\">排名前列：</span><span style=\"font-size: 12pt;font-family: Calibri;\">今年以来收益在</span><span style=\"font-size: 12pt;font-family: Calibri;\">3-5</span><span style=\"font-size: 12pt;font-family: Calibri;\">年利率债指数基金中排名</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">第</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">2</span><span style=\"font-size: 12pt;font-family: Calibri;\">，近</span><span style=\"font-size: 12pt;font-family: Calibri;\">1</span><span style=\"font-size: 12pt;font-family: Calibri;\">年、近</span><span style=\"font-size: 12pt;font-family: Calibri;\">2</span><span style=\"font-size: 12pt;font-family: Calibri;\">年、近</span><span style=\"font-size: 12pt;font-family: Calibri;\">3</span><span style=\"font-size: 12pt;font-family: Calibri;\">年业绩排名同类</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">前</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">5%</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;\">、</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">前</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">8%</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">、前</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">12%</span></p><p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: Calibri;font-weight: bold;\">回撤控制优：</span><span style=\"font-size: 12pt;font-family: Calibri;\">成立以来最大回撤为</span><span style=\"color: #C00000;font-size: 12pt;font-family: Calibri;font-weight: bold;\">-1.15%</span><span style=\"font-size: 12pt;font-family: Calibri;\">，优于同期业绩比较基准</span><span style=\"color: #808080;font-size: 12pt;font-family: Calibri;\">（</span><span style=\"color: #808080;font-size: 12pt;font-family: Calibri;\">-2.14%</span><span style=\"color: #808080;font-size: 12pt;font-family: Calibri;\">）</span></p><p style=\"text-align: left;\"><span style=\"font-size: 10pt;font-family: Calibri;\">&nbsp;</span></p>",
