              "fillColor": "",
              "content": "<p style=\"text-align: justify;\"><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">数据来源</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">:</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">业绩数据来自</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">Wind</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，年化波动率按日计算；排名来自银河证券，同类为债券基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">指数债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">利率债指数债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">(A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">类</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">)</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，近</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">1</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年、近</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年、近</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">3</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年业绩排名分别为</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">14/120</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">、</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">17/108</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">、</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">17/85</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，今年以来收益排名来自长城基金，选取</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">3-5</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年久期区间的利率债指数基金，排名第</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2/22</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，截至</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2024</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">8</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">月</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">31</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">日。</span></p>",
