              "borderColor": "#000",
              "borderWidth": 0,
              "borderType": "solid",
              "borderStrokeDasharray": "0",
              "fillColor": "",
              "content": "<p style=\"text-align: justify;\"><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">数据来源：规模数据来自长城基金，截至</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2024</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">6</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">月</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">30</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">日。评级数据来自海通证券，长城中债</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">1-3</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年政金债</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">评级截至</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2024</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">6</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">月</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">30</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">日、长城泰利纯债</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">A/C</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">评级截至</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2024</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">4</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">月</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">26</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">日。业绩排名来自银河证券，截至</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">2024</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">6</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">月</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">30</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">日。长城中债</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">5-10</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">年国开行债券指数</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">同类基金债券基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">指数债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">利率债指数债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">(A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">类</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">)</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，长城增强收益</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">同类基金为债券基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">普通债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">-</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">定开普通债券型基金</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">(</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">可投转债</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">)(A</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">类</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">)</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">，基金经理在管同类基金业绩说明详见附加页，评价结果并不是对未来表现的预测，</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">,</span><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">过往业绩不代表未来表现。投资须谨慎。</span></p>",
