              "borderColor": "#000",
              "borderWidth": 1,
              "borderType": "solid",
              "borderStrokeDasharray": "0",
              "fillColor": "",
              "content": "<ul><li style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: 微软雅黑;font-weight: bold;\">债券分层</span></li><li style=\"text-align: left;\"><span style=\"color: #0d0d0d;font-size: 9pt;font-family: 微软雅黑;\">根据债券剩余期限将标的指数成份券划分层级，按照分层抽样原理，确定各层级成份券及其权重</span></li>",
              "isFlipV": false,
