              "borderColor": "#000",
              "borderWidth": 1,
              "borderType": "solid",
              "borderStrokeDasharray": "0",
              "fillColor": "",
              "content": "<ul><li style=\"text-align: left;\"><span style=\"color: #0d0d0d;font-size: 12pt;font-family: 微软雅黑;font-weight: bold;\">筛选目标组合成分券</span></li><li style=\"text-align: left;\"><span style=\"color: #0d0d0d;font-size: 9pt;font-family: 微软雅黑;\">在各层级成份券内，利用动态最优化或随机抽样等方法，筛选出与各层级总体风险收益特征相近（例如久期、凸性等）、且流动性较好的个券组合（主要考虑发行规模、日均成交金额、期间成交天数等指标），或部分投资于非成份券，以更好地跟踪标的指数</span></li></ul><p style=\"text-align: left;\"><span style=\"font-size: 18pt;font-family: Calibri;\">&nbsp;</span></p>",
