              "content": "<ul><li style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: 微软雅黑;font-weight: bold;\">动态跟踪并调整仓位</span></li><li style=\"text-align: left;\"><span style=\"color: #404040;font-size: 9pt;font-family: 微软雅黑;\">根据债券流动性、基金日常申购赎回以及债券交易特性及交易惯例等情况，采取“久期匹配”等优化策略对基金资产进行抽样化调整</span></li><li style=\"text-align: left;\"><span style=\"color: #0d0d0d;font-size: 9pt;font-family: 微软雅黑;\">兼顾收益率和流动性，根据市场情况灵活调整久期和杠杆</span></li></ul><p style=\"text-align: left;\"><span style=\"font-size: 18pt;font-family: Calibri;\">&nbsp;</span></p><ul><li style=\"text-align: left;\"><span style=\"font-size: 18pt;font-family: Calibri;\">&nbsp;</span></li>",
