              "borderColor": "#000",
              "borderWidth": 0,
              "borderType": "solid",
              "borderStrokeDasharray": "0",
              "fillColor": "",
              "content": "<p style=\"text-align: left;\"><span style=\"color: #808080;font-size: 6pt;font-family: 微软雅黑;\">风险提示：以上基金经理观点，仅代表本材料制作之时基金经理结合当时的市场行情做出的分析判断，不代表基金未来长期实际投向。随着市场行情等因素的变化，基金经理的观点及投资方向会结合实际情况进行调整，基金的投资范围与投资限制以基金合同载明为准。</span></p>",
