                      "borderColor": "#000",
                      "borderWidth": 0,
                      "borderType": "solid",
                      "borderStrokeDasharray": "0",
                      "fillColor": "",
                      "content": "<p style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;font-weight: bold;\">一、市场观点</span></p><ul><li style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">短期来看，央行从</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">“</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">喊话</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">”</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">到</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">“</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">实质性</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">”</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">操作，叠加前期市场获利盘较多，短期长端或面临一定的调整压力，调整的空间和幅度需要继续观察央行与市场的博弈情况。</span></li><li style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">中长期来看，我们认为收益率中枢下行趋势不改：第一，从经济基本面角度看，在去地产化和高质量发展的背景下，增长中枢下行是长期趋势。第二，从机构投资者行为的角度看，机构资产荒的问题长期存在，其背后反应的是企业与居民信用收缩和金融机构负债扩张之间的长期矛盾。</span></li></ul><p style=\"text-align: left;\"><span style=\"font-size: 18pt;font-family: Calibri;\">&nbsp;</span></p><p style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;font-weight: bold;\">二、产品策略</span></p><ul><li style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">在收益率调整的过程中，利率债指数产品或会再次呈现长期配置价值。短期来看，指数基金产品在收益率震荡的过程中，在跟踪指数的基础上，利用市场波动采用小部份仓位进行灵活的波段操作，在跟踪指数收益的基础上或能同时有较好的回撤控制。</span></li><li style=\"text-align: left;\"><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">从</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">投资者角度看，我们认为调整后的债券市场或将重新具备较好的长期配置价值</span><span style=\"font-size: 10.5pt;font-family: 微软雅黑;\">。</span></li></ul><p style=\"text-align: left;\"><span style=\"font-size: 18pt;font-family: Calibri;\">&nbsp;</span></p>",
