              "content": "<p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: Calibri;\">长城基金成立于</span><span style=\"font-size: 12pt;font-family: Calibri;\">2001</span><span style=\"font-size: 12pt;font-family: Calibri;\">年</span><span style=\"font-size: 12pt;font-family: Calibri;\">12</span><span style=\"font-size: 12pt;font-family: Calibri;\">月，是证监会批准设立的第</span><span style=\"font-size: 12pt;font-family: Calibri;\">15</span><span style=\"font-size: 12pt;font-family: Calibri;\">家公募基金管理公司，注册资本</span><span style=\"font-size: 12pt;font-family: Calibri;\">1.5</span><span style=\"font-size: 12pt;font-family: Calibri;\">亿元人民币，总部设于深圳，在北京、上海、深圳分别设有分公司</span></p><p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: Calibri;\">公司股权结构稳定，在严格的业务隔离机制基础上支持公司长远、持续、稳健发展</span></p><p style=\"text-align: left;\"><span style=\"font-size: 12pt;font-family: Calibri;\">公司治理完善，</span><span style=\"font-size: 12pt;font-family: Calibri;\">“</span><span style=\"font-size: 12pt;font-family: Calibri;\">三会一层</span><span style=\"font-size: 12pt;font-family: Calibri;\">”</span><span style=\"font-size: 12pt;font-family: Calibri;\">架构健全，严格依法履行各自职责，保障组织高效运转</span></p>",
